Creates a [tf.Tensor](#class:Tensor) with the provided values, shape and dtype.

```js
// Pass an array of values to create a vector.
tf.tensor([1, 2, 3, 4]).print();
```

```js
// Pass a nested array of values to make a matrix or a higher
// dimensional tensor.
tf.tensor([[1, 2], [3, 4]]).print();
```

```js
// Pass a flat array and specify a shape yourself.
tf.tensor([1, 2, 3, 4], [2, 2]).print();
```

Creates rank-2 [tf.Tensor](#class:Tensor) with the provided values, shape and dtype.

The same functionality can be achieved with [tf.tensor()](#tensor), but in general
we recommend using [tf.tensor2d()](#tensor2d) as it makes the code more readable.

  ```js
// Pass a nested array.
tf.tensor2d([[1, 2], [3, 4]]).print();
```
```js
// Pass a flat array and specify a shape.
tf.tensor2d([1, 2, 3, 4], [2, 2]).print();
```

