Creates an empty [tf.TensorBuffer](#class:TensorBuffer) with the specified `shape` and `dtype`.

The values are stored in CPU as [TypedArray](https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/TypedArray). Fill the buffer using
`buffer.set()`, or by modifying directly `buffer.values`.

When done, call `buffer.toTensor()` to get an immutable [tf.Tensor](#class:Tensor) with
those values.

```js
// Create a buffer and set values at particular indices.
const buffer = tf.buffer([2, 2]);
buffer.set(3, 0, 0);
buffer.set(5, 1, 0);

// Convert the buffer back to a tensor.
buffer.toTensor().print();
```

Creates a new tensor with the same values and shape as the specified
tensor.

```js
const x = tf.tensor([1, 2]);

x.clone().print();
```

Converts two real numbers to a complex number.

Given a tensor `real` representing the real part of a complex number, and a
tensor `imag` representing the imaginary part of a complex number, this
operation returns complex numbers elementwise of the form [r0, i0, r1, i1],
where r represents the real part and i represents the imag part.

The input tensors real and imag must have the same shape.

```js
const real = tf.tensor1d([2.25, 3.25]);
const imag = tf.tensor1d([4.75, 5.75]);
const complex = tf.complex(real, imag);

complex.print();
```

Creates a [tf.Tensor](#class:Tensor) with all elements set to 1 with the same shape as the
given tensor.

```js
const x = tf.tensor([1, 2]);
tf.onesLike(x).print();
```

Prints information about the [tf.Tensor](#class:Tensor) including its data.

```js
const verbose = true;
tf.tensor2d([1, 2, 3, 4], [2, 2]).print(verbose);
```

Creates a new variable with the provided initial value.
```js
const x = tf.variable(tf.tensor([1, 2, 3]));
x.assign(tf.tensor([4, 5, 6]));

x.print();
```

Creates a [tf.Tensor](#class:Tensor) with all elements set to 0 with the same shape as the
given tensor.

```js
const x = tf.tensor([1, 2]);
tf.zerosLike(x).print();
```

This operation reshapes the "batch" dimension 0 into `M + 1` dimensions of
shape `blockShape + [batch]`, interleaves these blocks back into the grid
defined by the spatial dimensions `[1, ..., M]`, to obtain a result with
the same rank as the input. The spatial dimensions of this intermediate
result are then optionally cropped according to `crops` to produce the
output. This is the reverse of [tf.spaceToBatchND()](#spaceToBatchND). See below for a precise
description.

```js
const x = tf.tensor4d([1, 2, 3, 4], [4, 1, 1, 1]);
const blockShape = [2, 2];
const crops = [[0, 0], [0, 0]];

x.batchToSpaceND(blockShape, crops).print();
```

Casts a [tf.Tensor](#class:Tensor) to a new dtype.

```js
const x = tf.tensor1d([1.5, 2.5, 3]);
tf.cast(x, 'int32').print();
```

Returns a [tf.Tensor](#class:Tensor) that has expanded rank, by inserting a dimension
into the tensor's shape.

```js
const x = tf.tensor1d([1, 2, 3, 4]);
const axis = 1;
x.expandDims(axis).print();
```

Removes dimensions of size 1 from the shape of a [tf.Tensor](#class:Tensor).

```js
const x = tf.tensor([1, 2, 3, 4], [1, 1, 4]);
x.squeeze().print();
```

Concatenates a list of [tf.Tensor](#class:Tensor)s along a given axis.

The tensors ranks and types must match, and their sizes must match in all
dimensions except `axis`.

Also available are stricter rank-specific methods that assert that
`tensors` are of the given rank:
   - `tf.concat1d`
   - `tf.concat2d`
   - `tf.concat3d`
   - `tf.concat4d`

Except `tf.concat1d` (which does not have axis param), all methods have
same signature as this method.

```js
const a = tf.tensor1d([1, 2]);
const b = tf.tensor1d([3, 4]);
a.concat(b).print();  // or a.concat(b)
```

```js
const a = tf.tensor1d([1, 2]);
const b = tf.tensor1d([3, 4]);
const c = tf.tensor1d([5, 6]);
tf.concat([a, b, c]).print();
```

```js
const a = tf.tensor2d([[1, 2], [10, 20]]);
const b = tf.tensor2d([[3, 4], [30, 40]]);
const axis = 1;
tf.concat([a, b], axis).print();
```

Gather slices from tensor `x`'s axis `axis` according to `indices`.

```js
const x = tf.tensor1d([1, 2, 3, 4]);
const indices = tf.tensor1d([1, 3, 3], 'int32');

x.gather(indices).print();
```

```js
const x = tf.tensor2d([1, 2, 3, 4], [2, 2]);
const indices = tf.tensor1d([1, 1, 0], 'int32');

x.gather(indices).print();
```

Splits a [tf.Tensor](#class:Tensor) into sub tensors.

If `numOrSizeSplits` is a number, splits `x` along dimension `axis`
into `numOrSizeSplits` smaller tensors.
Requires that `numOrSizeSplits` evenly divides `x.shape[axis]`.

If `numOrSizeSplits` is a number array, splits `x` into
`numOrSizeSplits.length` pieces. The shape of the `i`-th piece has the
same size as `x` except along dimension `axis` where the size is
`numOrSizeSplits[i]`.

```js
const x = tf.tensor2d([1, 2, 3, 4, 5, 6, 7, 8], [2, 4]);
const [a, b] = tf.split(x, 2, 1);
a.print();
b.print();

const [c, d, e] = tf.split(x, [1, 2, 1], 1);
c.print();
d.print();
e.print();
```

Stacks a list of rank-`R` [tf.Tensor](#class:Tensor)s into one rank-`(R+1)` [tf.Tensor](#class:Tensor).

```js
const a = tf.tensor1d([1, 2]);
const b = tf.tensor1d([3, 4]);
const c = tf.tensor1d([5, 6]);
tf.stack([a, b, c]).print();
```

Unstacks a [tf.Tensor](#class:Tensor) of rank-`R` into a list of rank-`(R-1)` [tf.Tensor](#class:Tensor)s.

```js
const a = tf.tensor2d([1, 2, 3, 4], [2, 2]);

tf.unstack(a).forEach(tensor => tensor.print());
```

Creates a [tf.Tensor](#class:Tensor) with values drawn from a multinomial distribution.

```js
const probs = tf.tensor([.75, .25]);
tf.multinomial(probs, 3).print();
```

Creates a [tf.Sequential](#class:Sequential) model.  A sequential model is any model where the
outputs of one layer are the inputs to the next layer, i.e. the model
topology is a simple 'stack' of layers, with no branching or skipping.

This means that the first layer passed to a [tf.Sequential](#class:Sequential) model should have
a defined input shape. What that means is that it should have received an
`inputShape` or `batchInputShape` argument, or for some type of layers
(recurrent, Dense...) an `inputDim` argument.

The key difference between [tf.model()](#model) and [tf.sequential()](#sequential) is that
[tf.sequential()](#sequential) is less generic, supporting only a linear stack of layers.
[tf.model()](#model) is more generic and supports an arbitrary graph (without
cycles) of layers.

Examples:

```js
const model = tf.sequential();

// First layer must have an input shape defined.
model.add(tf.layers.dense({units: 32, inputShape: [50]}));
// Afterwards, TF.js does automatic shape inference.
model.add(tf.layers.dense({units: 4}));

// Inspect the inferred shape of the model's output, which equals
// `[null, 4]`. The 1st dimension is the undetermined batch dimension; the
// 2nd is the output size of the model's last layer.
console.log(JSON.stringify(model.outputs[0].shape));
```

It is also possible to specify a batch size (with potentially undetermined
batch dimension, denoted by "null") for the first layer using the
`batchInputShape` key. The following example is equivalent to the above:

```js
const model = tf.sequential();

// First layer must have a defined input shape
model.add(tf.layers.dense({units: 32, batchInputShape: [null, 50]}));
// Afterwards, TF.js does automatic shape inference.
model.add(tf.layers.dense({units: 4}));

// Inspect the inferred shape of the model's output.
console.log(JSON.stringify(model.outputs[0].shape));
```

You can also use an `Array` of already-constructed `Layer`s to create
a [tf.Sequential](#class:Sequential) model:

```js
const model = tf.sequential({
layers: [tf.layers.dense({units: 32, inputShape: [50]}),
tf.layers.dense({units: 4})]
});
console.log(JSON.stringify(model.outputs[0].shape));
```

A model is a data structure that consists of `Layers` and defines inputs
and outputs.

The key difference between [tf.model()](#model) and [tf.sequential()](#sequential) is that
[tf.model()](#model) is more generic, supporting an arbitrary graph (without
cycles) of layers. [tf.sequential()](#sequential) is less generic and supports only a linear
stack of layers.

When creating a [tf.LayersModel](#class:LayersModel), specify its input(s) and output(s). Layers
are used to wire input(s) to output(s).

For example, the following code snippet defines a model consisting of
two `dense` layers, with 10 and 4 units, respectively.

```js
// Define input, which has a size of 5 (not including batch dimension).
const input = tf.input({shape: [5]});

// First dense layer uses relu activation.
const denseLayer1 = tf.layers.dense({units: 10, activation: 'relu'});
// Second dense layer uses softmax activation.
const denseLayer2 = tf.layers.dense({units: 4, activation: 'softmax'});

// Obtain the output symbolic tensor by applying the layers on the input.
const output = denseLayer2.apply(denseLayer1.apply(input));

// Create the model based on the inputs.
const model = tf.model({inputs: input, outputs: output});

// The model can be used for training, evaluation and prediction.
// For example, the following line runs prediction with the model on
// some fake data.
model.predict(tf.ones([2, 5])).print();
```
See also:
   [tf.sequential()](#sequential), [tf.loadLayersModel()](#loadLayersModel).

Used to instantiate an input to a model as a [tf.SymbolicTensor](#class:SymbolicTensor).

Users should call the `input` factory function for
consistency with other generator functions.

Example:

```js
// Defines a simple logistic regression model with 32 dimensional input
// and 3 dimensional output.
const x = tf.input({shape: [32]});
const y = tf.layers.dense({units: 3, activation: 'softmax'}).apply(x);
const model = tf.model({inputs: x, outputs: y});
model.predict(tf.ones([2, 32])).print();
```

Note: `input` is only necessary when using `model`. When using
`sequential`, specify `inputShape` for the first layer or use `inputLayer`
as the first layer.

Load a graph model given a URL to the model definition.

Example of loading MobileNetV2 from a URL and making a prediction with a
zeros input:

```js
const modelUrl =
'https://storage.googleapis.com/tfjs-models/savedmodel/mobilenet_v2_1.0_224/model.json';
const model = await tf.loadGraphModel(modelUrl);
const zeros = tf.zeros([1, 224, 224, 3]);
model.predict(zeros).print();
```

Example of loading MobileNetV2 from a TF Hub URL and making a prediction with
a zeros input:

```js
const modelUrl =
'https://tfhub.dev/google/imagenet/mobilenet_v2_140_224/classification/2';
const model = await tf.loadGraphModel(modelUrl, {fromTFHub: true});
const zeros = tf.zeros([1, 224, 224, 3]);
model.predict(zeros).print();
```

Load a model composed of Layer objects, including its topology and optionally
weights. See the Tutorial named "How to import a Keras Model" for usage
examples.

This method is applicable to:

1. Models created with the `tf.layers.*`, [tf.sequential()](#sequential), and
[tf.model()](#model) APIs of TensorFlow.js and later saved with the
[tf.LayersModel.save()](#tf.LayersModel.save) method.
2. Models converted from Keras or TensorFlow tf.keras using
    the [tensorflowjs_converter](https://github.com/tensorflow/tfjs-converter)

This mode is *not* applicable to TensorFlow `SavedModel`s or their converted
forms. For those models, use [tf.loadGraphModel()](#loadGraphModel).

Example 1. Load a model from an HTTP server.

```js
const model = await tf.loadLayersModel(
'https://storage.googleapis.com/tfjs-models/tfjs/iris_v1/model.json');
model.summary();
```

Example 2: Save `model`'s topology and weights to browser [local
storage](https://developer.mozilla.org/en-US/docs/Web/API/Window/localStorage);
then load it back.

```js
const model = tf.sequential(
{layers: [tf.layers.dense({units: 1, inputShape: [3]})]});
console.log('Prediction from original model:');
model.predict(tf.ones([1, 3])).print();

const saveResults = await model.save('localstorage://my-model-1');

const loadedModel = await tf.loadLayersModel('localstorage://my-model-1');
console.log('Prediction from loaded model:');
loadedModel.predict(tf.ones([1, 3])).print();
```

Example 3. Saving `model`'s topology and weights to browser
[IndexedDB](https://developer.mozilla.org/en-US/docs/Web/API/IndexedDB_API);
then load it back.

```js
const model = tf.sequential(
{layers: [tf.layers.dense({units: 1, inputShape: [3]})]});
console.log('Prediction from original model:');
model.predict(tf.ones([1, 3])).print();

const saveResults = await model.save('indexeddb://my-model-1');

const loadedModel = await tf.loadLayersModel('indexeddb://my-model-1');
console.log('Prediction from loaded model:');
loadedModel.predict(tf.ones([1, 3])).print();
```

Example 4. Load a model from user-selected files from HTML
[file input
elements](https://developer.mozilla.org/en-US/docs/Web/HTML/Element/input/file).

```js
// Note: this code snippet will not work without the HTML elements in the
//   page
const jsonUpload = document.getElementById('json-upload');
const weightsUpload = document.getElementById('weights-upload');

const model = await tf.loadLayersModel(
tf.io.browserFiles([jsonUpload.files[0], weightsUpload.files[0]]));
```

Creates an IOHandler that triggers file downloads from the browser.

The returned `IOHandler` instance can be used as model exporting methods such
as `tf.Model.save` and supports only saving.

```js
const model = tf.sequential();
model.add(tf.layers.dense(
{units: 1, inputShape: [10], activation: 'sigmoid'}));
const saveResult = await model.save('downloads://mymodel'));
// This will trigger downloading of two files:
//   'mymodel.json' and 'mymodel.weights.bin'.
console.log(saveResult);
```

Creates an IOHandler that loads model artifacts from user-selected files.

This method can be used for loading from files such as user-selected files
in the browser.
When used in conjunction with `tf.loadModel`, an instance of `tf.Model`
(Keras-style) can be constructed from the loaded artifacts.

```js
// Note: This code snippet won't run properly without the actual file input
//   elements in the HTML DOM.

// Suppose there are two HTML file input (`<input type="file" ...>`)
// elements.
const uploadJSONInput = document.getElementById('upload-json');
const uploadWeightsInput = document.getElementById('upload-weights');
const model = await tfl.loadModel(tf.io.browserFiles(
[uploadJSONInput.files[0], uploadWeightsInput.files[0]]));
```

Copy a model from one URL to another.

This function supports:

1. Copying within a storage medium, e.g.,
    `tf.io.copyModel('localstorage://model-1', 'localstorage://model-2')`
2. Copying between two storage mediums, e.g.,
    `tf.io.copyModel('localstorage://model-1', 'indexeddb://model-1')`

```js
// First create and save a model.
const model = tf.sequential();
model.add(tf.layers.dense(
{units: 1, inputShape: [10], activation: 'sigmoid'}));
await model.save('localstorage://demo/management/model1');

// Then list existing models.
console.log(JSON.stringify(await tf.io.listModels()));

// Copy the model, from Local Storage to IndexedDB.
await tf.io.copyModel(
'localstorage://demo/management/model1',
'indexeddb://demo/management/model1');

// List models again.
console.log(JSON.stringify(await tf.io.listModels()));

// Remove both models.
await tf.io.removeModel('localstorage://demo/management/model1');
await tf.io.removeModel('indexeddb://demo/management/model1');
```

List all models stored in registered storage mediums.

For a web browser environment, the registered mediums are Local Storage and
IndexedDB.

```js
// First create and save a model.
const model = tf.sequential();
model.add(tf.layers.dense(
{units: 1, inputShape: [10], activation: 'sigmoid'}));
await model.save('localstorage://demo/management/model1');

// Then list existing models.
console.log(JSON.stringify(await tf.io.listModels()));

// Delete the model.
await tf.io.removeModel('localstorage://demo/management/model1');

// List models again.
console.log(JSON.stringify(await tf.io.listModels()));
```

