Constructs a [tf.SGDOptimizer](#class:train.Optimizer) that uses stochastic gradient descent.

```js
// Fit a quadratic function by learning the coefficients a, b, c.
const xs = tf.tensor1d([0, 1, 2, 3]);
const ys = tf.tensor1d([1.1, 5.9, 16.8, 33.9]);

const a = tf.scalar(Math.random()).variable();
const b = tf.scalar(Math.random()).variable();
const c = tf.scalar(Math.random()).variable();

// y = a * x^2 + b * x + c.
const f = x => a.mul(x.square()).add(b.mul(x)).add(c);
const loss = (pred, label) => pred.sub(label).square().mean();

const learningRate = 0.01;
const optimizer = tf.train.sgd(learningRate);

// Train the model.
for (let i = 0; i < 10; i++) {
optimizer.minimize(() => loss(f(xs), ys));
}

// Make predictions.
console.log(
`a: ${a.dataSync()}, b: ${b.dataSync()}, c: ${c.dataSync()}`);
const preds = f(xs).dataSync();
preds.forEach((pred, i) => {
console.log(`x: ${i}, pred: ${pred}`);
});
```

Executes the provided function `fn` and after it is executed, cleans up all
intermediate tensors allocated by `fn` except those returned by `fn`.
`fn` must not return a Promise (async functions not allowed). The returned
result can be a complex object.

Using this method helps avoid memory leaks. In general, wrap calls to
operations in [tf.tidy()](#tidy) for automatic memory cleanup.

When in safe mode, you must enclose all [tf.Tensor](#class:Tensor) creation and ops
inside a [tf.tidy()](#tidy) to prevent memory leaks.

```js
// y = 2 ^ 2 + 1
const y = tf.tidy(() => {
// a, b, and one will be cleaned up when the tidy ends.
const one = tf.scalar(1);
const a = tf.scalar(2);
const b = a.square();

console.log('numTensors (in tidy): ' + tf.memory().numTensors);

// The value returned inside the tidy function will return
// through the tidy, in this case to the variable y.
return b.add(one);
});

console.log('numTensors (outside tidy): ' + tf.memory().numTensors);
y.print();
```

Keeps a [tf.Tensor](#class:Tensor) generated inside a [tf.tidy()](#tidy) from being disposed
automatically.

```js
let b;
const y = tf.tidy(() => {
const one = tf.scalar(1);
const a = tf.scalar(2);

// b will not be cleaned up by the tidy. a and one will be cleaned up
// when the tidy ends.
b = tf.keep(a.square());

console.log('numTensors (in tidy): ' + tf.memory().numTensors);

// The value returned inside the tidy function will return
// through the tidy, in this case to the variable y.
return b.add(one);
});

console.log('numTensors (outside tidy): ' + tf.memory().numTensors);
console.log('y:');
y.print();
console.log('b:');
b.print();
```

Executes the provided function `f()` and returns a promise that resolves
with information about the function's memory use:
- `newBytes`: tne number of new bytes allocated
- `newTensors`: the number of new tensors created
- `peakBytes`: the peak number of bytes allocated
- `kernels`: an array of objects for each kernel involved that reports
their input and output shapes, number of bytes used, and number of new
tensors created.

```js
const profile = await tf.profile(() => {
const x = tf.tensor1d([1, 2, 3]);
let x2 = x.square();
x2.dispose();
x2 = x.square();
x2.dispose();
return x;
});

console.log(`newBytes: ${profile.newBytes}`);
console.log(`newTensors: ${profile.newTensors}`);
console.log(`byte usage over all kernels: ${profile.kernels.map(k =>
k.totalBytesSnapshot)}`);
```

